import React from "react";
import { Link, useLocation } from "react-router-dom";
import "./user_list.css"

const User = ({ user }) => {
    const users = useLocation((state) => state.users);

    return (

        users.map((user, i) => {
            return (
                <Link to="/">

                    <div> {user.username}</div>

                </Link>
            )

        }
        )

    )
};

export default User;
